import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  root: {},
  header: {
    height: "10%",
    width: "100%",
  },
  homePage: {
    height: "auto",
    width: "100%",
  },
  bottom: {
    minHeight: "10rem",
    backgroundColor: theme.palette.primary.light,
  },
}));

export default useStyles;
